    false,nt"url": null,nt"notes": "This narrative report for Tewaukon National
    Wildlife Refuge summarizes refuge activities for the 1964 calendar year.  The report
    begins with a summary of the weather and habitat conditions during this period.
     Wildlife- including migratory birds, upland game birds, big game animals, fur
    animals, predators, rodents, other mammals, predacious birds, fish, and reptiles-
    is also covered.  The report includes a refuge development and maintenance section
    which discusses physical developments, plantings, collections, receipts, vegetation
    control, and fires.  Resources management is outlined; grazing, fur harvest, and
    commercial fishing were the primary resources used during this period.  A progress
    report on field investigation and applied research is also provided.  The public
    relations section of the report discusses recreational uses of the refuge, refuge
    visitors, refuge participation, hunting, and violations.  Finally, items of interest,
    photographs, easements and WPA information, and N-R forms are provided.",nt"owner_org":
